DROP TRIGGER IF EXISTS `antes_insertar_consolidado`;
DELIMITER //
CREATE TRIGGER `antes_insertar_consolidado` BEFORE INSERT ON `consolidado`
 FOR EACH ROW BEGIN

IF NEW.conso_paso_rsc = 'R-RSC-007' THEN
    set new.conso_paso_rsc='SI';
    set new.conso_sp='R-RSC-007';  
    set new.conso_estado_and = 'REVISAR';
END IF;

IF NEW.conso_base_org = 'ACTIVO EN ANDROMEDA' THEN
    	set new.conso_estado_evid='NO LIQUIDADO';
 	ELSE IF NEW.conso_base_org = 'NO ACTIVO EN ANDROMEDA' OR NEW.conso_base_org = 'NO ACTIVO EN CONTRATISTA' THEN
    	set new.conso_estado_evid='POR DEFINIR';
    END IF;
END IF;

/*IF NEW.conso_base_org = 'ACTIVO EN ANDROMEDA' OR NEW.conso_base_org = 'NO ACTIVO EN CONTRATISTA' THEN
    	set new.conso_estado_and='VINCULADO';
END IF;

IF NEW.conso_base_org = 'NO ACTIVO EN ANDROMEDA' THEN
    	set new.conso_estado_and='NO APLICA';
END IF;*/

/*Estaco en andromeda traido del archivo remitido*/
IF EXISTS (SELECT distinct prem_cedula FROM personal_remitido where (prem_cedula like NEW.conso_cedula) and inter_id = NEW.inter_id) THEN
	set new.conso_estado_and = (SELECT prem_estado_cand FROM personal_remitido where prem_cedula = NEW.conso_cedula GROUP BY prem_cedula HAVING MAX(prem_fech_crea));
END IF;

IF EXISTS (SELECT * FROM personal_remitido where (prem_cedula like NEW.conso_cedula) and inter_id=NEW.inter_id) THEN
	set new.conso_sp = (SELECT prem_id_sol FROM personal_remitido where prem_cedula = NEW.conso_cedula GROUP BY prem_cedula HAVING MAX(prem_fech_crea));
    set new.conso_paso_rsc='SI';
    
    ELSE
    
IF NOT EXISTS (SELECT * FROM personal_remitido where prem_cedula like NEW.conso_cedula and inter_id=NEW.inter_id) AND new.conso_sp != 'R-RSC-007' THEN
    	set new.conso_sp = NULL;
    	set new.conso_paso_rsc = 'NO';
        set new.conso_estado_and = 'REVISAR';
    END IF;
END IF;

/*Comunidad que lo remitio*/
IF EXISTS (SELECT distinct prem_cedula FROM personal_remitido where (prem_cedula like NEW.conso_cedula) and inter_id = NEW.inter_id) THEN
	set new.conso_comunidad_rem = (SELECT prem_org_cand FROM personal_remitido where prem_cedula = NEW.conso_cedula GROUP BY prem_cedula HAVING MAX(prem_fech_crea));
    ELSE
    IF NOT EXISTS (SELECT distinct prem_cedula FROM personal_remitido where (prem_cedula like NEW.conso_cedula) and inter_id = NEW.inter_id) THEN
    	set new.conso_comunidad_rem = 'NULL';
    END IF;
END IF;

END
//
DELIMITER ;

